// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

library utils {
    IERC20 constant public TOKEN = IERC20(address(0));
    address constant public COMPANY_ADDRESS = address(0x604e7E66c0C2897325375dC85Aa7686e432236a1);
    uint8 constant public COMPANY_FEE_PERCENT = 1;
    uint256 constant public PRICE_THRESHOLD = 10000; // 100 TST
    uint constant public MIN_JUDGMENT_TIME = 1 minutes - 1;

    struct ExecutorData {
        address executorAddress;
        bool wasChosen;
    }

    struct TaskData {
        uint256 id;
        bytes32 sha256hashsum;
        uint timestamp;
    }

    struct SolutionData {
        uint256 id;
        bytes32 sha256hashsum;
        uint timestamp;
    }

    struct JudgeVote {
        uint256 id;
        bytes32 sha256hashsum;
        uint timestamp;
        bool verdict; // true = поддержать претензии; false = отклонить
        address judgeAddress;
    }

    struct Argument {
        uint256 id;
        bytes32 sha256hashsum;
        uint timestamp;
    }
}

